(932, 1036, 'Conectar', 'todos los sensores y dispositivos a la unidad de control', 350),
(933, 1037, 'Almacenar', 'el aceite lubricante necesario para mantener lubricadas todas las partes móviles del motor diesel. Este aceite es fundamental para reducir la fricción y el desgaste, optimizando así el rendimiento y prolongando la vida útil del motor.', 352),
(934, 1038, 'Impulsar', 'continuamente el aceite lubricante a través del sistema para asegurar que todas las partes móviles del motor estén adecuadamente lubricadas y protegidas contra el desgaste.', 352),
(935, 1039, 'Filtrar', 'impurezas y partículas nocivas presentes en el aceite lubricante, asegurando que el lubricante circulante esté limpio y libre de contaminantes que podrían dañar las superficies internas del motor.', 352),
(936, 1040, 'Conducir', 'el aceite lubricante desde la bomba hacia los diferentes componentes del motor y de regreso al depósito de aceite', 352),
(937, 1857, 'Conducir', 'el aceite lubricante desde la bomba hacia los diferentes componentes del motor y de regreso al depósito de aceite', 352),
(941, 1041, 'Transferir', 'calor entre dos fluidos, permitiendo que el calor se mueva desde el fluido caliente al fluido más frío sin que estos se mezclen directamente', 351),
(942, 1042, 'Mover', 'el aire a través del sistema de refrigeración del motor diesel para disipar el calor generado por la combustión y mantener una temperatura óptima de funcionamiento', 351),
(943, 1043, 'Filtrar', 'partículas, sedimentos y agua en los diferentes sistema en el que aplique', 351),
(944, 1044, 'Regular', 'la temperatura del motor diesel controlando el flujo del líquido refrigerante. Cuando la temperatura del motor alcanza un nivel específico, el termostato se abre o se cierra para permitir o restringir el flujo de refrigerante hacia el radiador', 351),
(945, 1045, 'Impulsar', ' el líquido refrigerante a través del sistema de enfriamiento del motor diesel, facilitando la disipación del calor generado por la combustión y manteniendo así una temperatura adecuada de funcionamiento del motor.', 351),
(946, 1854, 'Conducir', 'los fluidos necesarios para el funcionamiento', 351),
(947, 1855, 'Conducir', 'los fluidos necesarios para el funcionamiento', 351),
(948, 1856, 'Enfriar', 'el refrigerante que ya ha pasado por el sistema', 351),
(949, 1018, 'Suministrar', 'aire limpio y filtrado al motor diesel para la combustión eficiente.', 349),
(950, 1019, 'Aumentar', 'la presión y densidad del aire que entra al motor, mejorando así la potencia y eficiencia general del motor.', 349),
(951, 1020, 'Suministrar', 'combustible al motor diesel en la cantidad y presión adecuadas para la combustión', 349),
(952, 1021, 'Atomizar', 'el combustible directamente en los cilindros del motor diésel durante la fase de combustión, facilitando así una mezcla adecuada con el aire.', 349),
(953, 1022, 'Filtrar ', 'el combustible para proteger los componentes del motor diesel contra daños por contaminantes', 349),
(954, 1023, 'Dirigir', ' los gases de escape lejos del motor diesel hacia el sistema de escape para reducir las emisiones y el ruido.', 349),
(955, 1024, 'Contener', 'los pistones y facilitan la combustión controlada dentro del motor diesel.', 349),
(956, 1025, 'Convertir', 'el movimiento alternativo de los pistones en movimiento rotativo continuo, que luego se transmite a través del sistema de transmisión.', 349),
(957, 1026, 'Soportar', ' son rodamientos que conectan cada pistón con el cigüeñal, permitiendo que el movimiento alternativo del pistón se convierta en movimiento rotativo del cigüeñal.', 349),
(958, 1027, 'Sellar', 'las juntas y conexiones del motor diesel para prevenir fugas y mantener la eficiencia del sistema', 349),
(959, 1028, 'Conducir', 'los fluidos de funcionamiento del motor generador (Lubricantes, refrigerantes, agua, combustible)', 349),
(960, 1029, 'Regular', 'el flujo de aire y gases dentro y fuera de los cilindros del motor diesel para optimizar la combustión y la eficiencia', 349),
(961, 1030, 'Albergar', ' las válvulas y sella los cilindros del motor diesel para mantener la presión y la eficiencia de combustión.', 349),
(962, 1031, 'Recibir', 'el refrigerante', 349),
(963, 1850, 'Comprimir ', 'el combustible en el cilindro', 349),
(964, 1851, 'Soportar', 'el motor', 349),
(965, 1852, 'Conducir', 'los fluidos necesarios para el funcionamiento', 349),
(966, 1853, 'Conducir', 'los fluidos necesarios para el funcionamiento', 349),
(967, 1012, 'Generar', 'un campo magnético estacionario que interactúa con el rotor para inducir corriente eléctrica en los devanados del estator, produciendo electricidad.', 348),
(968, 1013, 'Inducir', 'corriente eléctrica en los devanados del rotor que se convierte en la salida eléctrica del generador.', 348),
(969, 1014, 'Soportar', 'el giro del rotor y del eje dentro del generador eléctrico, minimizando la fricción y manteniendo la alineación correcta de los componentes.', 348),
(970, 1015, 'Suministrar', 'la corriente de excitación al rotor, creando un campo magnético giratorio que, junto con el estator, induce corriente eléctrica en los devanados del estator.', 348),
(971, 1016, 'Regular', ' automáticamente la tensión de salida del generador eléctrico ajustando el campo magnético del rotor según las variaciones de carga, asegurando así una tensión de salida estable y consistente.', 348),
(972, 1017, 'Conectar', ' cables y conductores que transportan la electricidad generada hacia los puntos de uso o a la red eléctrica.', 348),
(973, 1046, 'Suministrar', 'la energía o aire necesaria para encender el equipo', 353),
(974, 1047, 'Convertir', 'la energía suministrada en una rotación inicial o explosión que active el motor de combustión', 353),
(975, 1048, 'Controlar', 'el arranque del motor', 353),
(976, 1010, 'Conectar', 'de manera mecánica y segura el generador al motor de combustión para transmitir eficientemente la potencia generada', 347),
(977, 1011, 'Transmitir', 'el movimiento rotacional desde el motor de combustión al generador', 347);
