INSERT INTO `equipo_info` (`id`, `nombre_equipo`, `AOR`, `fecha`, `fiabilidad_equipo`, `MTBF`, `GRES`, `criticidad_equipo`, `marca`, `peso_seco`, `modelo`, `dimensiones`, `descripcion`, `imagen`, `id_personal`, `id_diagrama`, `id_procedimiento`, `id_sistema`, `id_equipo`, `estado`) VALUES
(463, 'Motor generador CAT C18', 8760, '2024-11-12', 0, 19234, 0, 0, 'CAT', 4786, 'C18', '2863x1221x1782', 'El grupo electrógeno principal está compuesto por un motor diésel Cat C18- SCAC-DITA- ACERT Marine Gense Engine de Caterpillar, acoplado a un alternador. Las especificaciones principales del motor incluyen una potencia nominal de 465 bkW, seis cilindros en configuración en línea (L), una cilindrada de 18,1 litros y una velocidad nominal de 1800 RPM. El diámetro del cilindro es de 145 mm y la carrera del pistón de 183 mm, con aspiración de tipo TA. La velocidad de ralentí alto es de 1854 RPM, y la velocidad mínima de ralentí programable es de 1200 RPM. El motor proporciona un par nominal de 2467 Nm y cuenta con un gobernador electrónico ADEM™ 4, con un sistema de combustible MEUI™. La rotación del motor es en sentido contrario a las agujas del reloj (CCW) y la caja del volante es del tipo SAE No 0/18 pulgadas con 136 dientes.\r\n\r\nEl alternador, marca LEROY SOMER, modelo LSAM 49.3 S4/4P, tiene una potencia nominal de 538 KVA (430 kWe o 456 kWm) y un voltaje de 440 V. Su rango de tensión nominal es de ±5 %, con un factor de potencia de 0.8 y una velocidad nominal de 1800 RPM. La frecuencia es de 60 Hz y su corriente nominal es de 706 A. El tipo de bobinado es p/2/3, con clases de aislamiento H/F, y está diseñado para operar en una temperatura ambiente de hasta 50 °C y una altitud de 1000 metros sobre el nivel del mar. El tipo de AVR es un modelo digital Leroy Somer - D350.', , 10, 509, 511, 253, 169, 'activo');
