INSERT INTO `mta` (`id`, `id_rcm`, `id_equipo_info`, `id_sistema`, `id_componente`, `id_falla_funcional`, `id_descripcion_modo_falla`, `id_tipo_mantenimiento`, `id_tarea_mantenimiento`, `cantidad_personal`, `consumibles_requeridos`, `requeridos_tarea`, `condiciones_ambientales`, `condiciones_estado_equipo`, `condiciones_especiales`, `horas`, `minutos`, `detalle_tarea`, `estado`) VALUES
(1, 10, 463, 264, 1047, 46, 88, 1, 3, 2, '', '', '\"Temperatura del aire:\r\n+10 °C to +40 °C\r\nHumedad relativa:\r\n60-90%\r\nPresión barométrica (presión aire):\r\n950 hPa-1050 hPa\r\nSalinidad aire:\r\n1 mg/m3\r\nSalinidad agua de mar:\r\n3.5 % at RHO = 1.025 t/m³\r\nTemperatura superficie agua de mar:\r\n32 °C\r\nRadiación ', 'Apagado sin alimentacion', '', 4.00, 0.00, '\"Revise el compresor y las entradas de aire\r\n\r\n1. Desconecta la alimentación del compresor.\r\n2. Inspecciona visualmente el compresor en busca de signos de desgaste o fugas de aire.\r\n3. Revisa las entradas de aire, asegurándote de que no haya obstrucciones', 'activo'),
(2, 12, 463, 264, 1047, 1, 87, 1, 3, 0, '', '', '\"Temperatura del aire:\r\n+10 °C to +40 °C\r\nHumedad relativa:\r\n60-90%\r\nPresión barométrica (presión aire):\r\n950 hPa-1050 hPa\r\nSalinidad aire:\r\n1 mg/m3\r\nSalinidad agua de mar:\r\n3.5 % at RHO = 1.025 t/m³\r\nTemperatura superficie agua de mar:\r\n32 °C\r\nRadiación ', 'Apagado sin alimentacion', '', 4.00, 0.00, 'Reemplace el compresor de aire\r\n\r\n1. Apaga el sistema y desconecta el compresor del sistema eléctrico y del suministro de aire.\r\n2. Retira los pernos de montaje del compresor utilizando una llave dinamométrica, aplicando el torque adecuado especificado en', 'activo'),
(3, 13, 463, 264, 1047, 1, 89, 2, 4, 2, '', '', '\"Temperatura del aire:\r\n+10 °C to +40 °C\r\nHumedad relativa:\r\n60-90%\r\nPresión barométrica (presión aire):\r\n950 hPa-1050 hPa\r\nSalinidad aire:\r\n1 mg/m3\r\nSalinidad agua de mar:\r\n3.5 % at RHO = 1.025 t/m³\r\nTemperatura superficie agua de mar:\r\n32 °C\r\nRadiación ', 'Apagado sin alimentacion', '', 4.00, 0.00, 'Limpie el mecanismo de arranque \r\n\r\n1. Desconecta la alimentación al sistema de arranque para evitar accidentes.\r\n2. Retira el mecanismo de arranque del motor y desmonta las piezas.\r\n3. Limpia cada componente del mecanismo de arranque con un limpiador no ', 'activo');
