INSERT INTO `procedimientos` (`id`, `arranque`, `parada`) VALUES
(511, '1. antes de arrancar el motor:\r\n\r\n• Asegúrate de que no haya etiquetas de \"NO OPERAR\" en el interruptor de arranque o en los controles.\r\n• Inspecciona visualmente que no haya personas cerca del motor.\r\n• Verifica los niveles de aceite y refrigerante, manteniéndolos en el nivel adecuado .\r\n2. Arranque del motor:\r\n• Gira el interruptor de encendido a la posición \"RUN\".\r\n• Si el motor está equipado con ayuda de arranque, presiona el interruptor de \"STARTING AID\" para mejorar el arranque en frío.\r\n• Deja que el motor funcione al ralentí entre 3 y 5 minutos hasta que la temperatura del agua comience a aumentar .\r\n3. Verificaciones tras el arranque:\r\n• Asegúrate de que la presión del aceite se estabilice en los primeros 15 segundos.\r\n• Verifica que no haya fugas de aire o fluidos y revisa todos los indicadores y medidores .\r\n4. Funcionamiento:\r\n• Aumenta gradualmente las revoluciones a un cuarto del régimen total de carga, y permite que el motor opere a baja carga hasta que todos los sistemas alcancen la temperatura de operación .\r\n', '1. Reducción de la carga:\r\no Reduce las RPM del motor al mínimo y deja que funcione en ralentí durante al menos 3 minutos para estabilizar la temperatura interna .\r\n2. Procedimiento de parada manual:\r\no Aumenta las revoluciones hasta el 50% del régimen nominal por 3 a 5 minutos para enfriar el motor.\r\no Una vez estabilizado, reduce las revoluciones nuevamente al ralentí y presiona el interruptor de \"STOP\" .\r\n3. Después de la parada del motor:\r\no Deja que el motor se enfríe y espera 10 minutos para que el aceite regrese al cárter antes de verificar su nivel.\r\no Realiza ajustes menores si es necesario, repara fugas y ajusta pernos sueltos.\r\no Llena el tanque de combustible para evitar la acumulación de humedad y suciedad.\r\n');
